import React, {useEffect, useState} from "react";
import {useSelector} from "react-redux";
import "./style.css";
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome'
import {faHome} from "@fortawesome/free-solid-svg-icons";
import {faCheck} from "@fortawesome/free-solid-svg-icons";
import {faTimes} from "@fortawesome/free-solid-svg-icons";

const ExtensionsList = (props) => {
    const devicesData = useSelector(state => state.devicesData);
    const loginData = useSelector(state => state.loginData);
    const [id, getId] = useState('')
    const checkOwnerId = (item) => {
        console.log("item", item)

        if (loginData.item !== undefined) {
            console.log("loginData.item[0].data.owner_id", loginData.item[0].data.owner_id)
            console.log("devicelist", devicesData)
            let id = loginData.item[0].data.owner_id;
            getId(id);

        }

    };
    useEffect(() => {
        checkOwnerId(devicesData)
    }, [loginData])
    return (
        <React.Fragment>
            <div className="container">

                <table className="table table-sm table-striped table-bordered table-hover">
                    <thead>
                    <tr>
                        <th>Device Name</th>
                        <th>Enabled</th>
                    </tr>
                    </thead>
                    <tbody>{
                        devicesData === undefined ? null : devicesData.map((item, i) => {

                            return (
                                item.owner_id === id ?

                                    <tr key={i}>

                                        <td>
                                            {item.name}
                                        </td>
                                        <td className="device-name">

                                            {item.enabled ? <FontAwesomeIcon color="green" icon={faCheck}/> :
                                                <FontAwesomeIcon color="red" icon={faTimes}/>}

                                        </td>
                                    </tr> : null
                            )

                        })
                    }</tbody>
                </table>
            </div>

        </React.Fragment>
    )
};


export default ExtensionsList;
